const FavS = () =>{
if( favSeries === "netflix"){
   return <Nextflix/>;
}
else {
    return <Amazon/>;
}

}
const App = () =>{
return(
 <>
 <div className='container'>
    <FavS />
</div>
 </>
 );
}

export default App;
